import React from 'react';

// 재사용성을 높이기 위해 
function User({user}) {
    return (
        <div>
            <b>{user.username}</b> <span>({user.email})</span>
        </div>
    );
}



function UserList(){
    const users = [
        {
            id:1,
            username:'likelion1',
            email:'likelion1@gmail.com'
        },
        {
            id:2,
            username:'likelion2',
            email:'likelion3@gmail.com'
        },
        {
            id:3,
            username:'likelion3',
           email:'likelion3@gmail.com'
        }
    ];
    return(
        <div>
            {users.map(user => (
                <User user={user} key={user.id}/>
            ))}
        </div>
    );
}


export default UserList;
